import { BrowserRouter, Route, Router, Routes } from "react-router-dom";
import "./App.css";
import Chan from "./components/chan";
import LoginPage from "./components/LoginPage/loginpage";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" exact element={<LoginPage></LoginPage>}></Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
